const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		width: "100%",
		height: "auto"
	},
	imageSrc: {
		padding: "10px",
		'&::after': {
			content: 'img',
			width: "100%",
			height: "100%"
		}
	},
};

export default ImageGridListStyle;
